    count_0, count_1, count_2 = 0, 0, 0

    # Count the occurrences of each number
    for num in arr:
        if num == 0:
            count_0 += 1
        elif num == 1:
            count_1 += 1
        else:
            count_2 += 1

    # Place the numbers back into the array in sorted order
    index = 0
    while count_0 > 0:
        arr[index] = 0
        index += 1
        count_0 -= 1

    while count_1 > 0:
        arr[index] = 1
        index += 1
        count_1 -= 1

    while count_2 > 0:
        arr[index] = 2
        index += 1
        count_2 -= 1

    return arr

