def sum_of_prime_divisors(n):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    divisors = []
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            if is_prime(i):
                divisors.append(i)
            if i != n // i:
                if is_prime(n // i):
                    divisors.append(n // i)

    return sum(divisors)

